const Home = () => {
    return (
        <>
            <h2>Welcome to Fitness Trac.kr!</h2>
            <p><em>Don't walk into the gym without a plan!</em></p>
            <p>Build and share your own workout routines.</p>
        </>
    )
}

export default Home;
